import { Navigate } from "react-router-dom";

type MyProps = {
  children: JSX.Element;
  users?: boolean;
};

export const ProtectedRoutes = ({ children, users }: MyProps): JSX.Element => {
  if (!users) {
    console.log(users);
  }
  return children;
};
